\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"bc9d237\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[],\"isInner\":false}],\"isInner\":false},{\"id\":\"bfe3f84\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"ab9eca9\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"c0cac21\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><span style=\\\"color: #404040; font-style: inherit; font-weight: inherit; font-family: var( --e-global-typography-text-font-family ), Sans-serif; background-color: var(--ast-global-color-5);\\\">Search engine marketing, or SEM, is one of the most effective ways to grow your business in an increasingly competitive marketplace. With millions of businesses out there all vying for the same eyeballs, it\\u2019s never been more important to advertise online, and search engine marketing is the most effective way to promote your products and grow your business.<\\/span><\\/p><p>\\u00a0<\\/p><p style=\\\"margin-bottom: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span lang=\\\"EN\\\" style=\\\"color: #404040;\\\">In this guide, you\\u2019ll learn an overview of search engine marketing basics as well as some tips and strategies for doing search engine marketing right.<\\/span><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"28efc12\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"df528a4\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"ce20f9d\",\"elType\":\"widget\",\"settings\":{\"title\":\"Search Engine Marketing \\u2013 An Overview\",\"header_size\":\"h3\",\"align\":\"center\",\"title_color\":\"#7A12DF\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"140683a\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"0e7470d\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"fd9cebc\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Search engine marketing is the practice of marketing a business using paid advertisements that appear on search engine results pages (or SERPs). Advertisers bid on keywords that users of services such as Google and Bing might enter when looking for certain products or services, which gives the advertiser the opportunity for their ads to appear alongside results for those search queries.<\\/p><p>These ads, often known by the term pay-per-click ads, come in a variety of formats. Some are small, text-based ads, whereas others, such as product listing ads (PLAs, also known as Shopping ads) are more visual, product-based advertisements that allow consumers to see important information at-a-glance, such as price and reviews.<\\/p><p>Search engine marketing\\u2019s greatest strength is that <strong>it offers advertisers the opportunity to put their ads in front of motivated customers who are ready to buy at the precise moment they\\u2019re ready to make a purchase<\\/strong>. No other advertising medium can do this, which is why search engine marketing is so effective and such an amazingly powerful way to grow your business.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
